INSERT INTO `sys_log` VALUES (1782961766146433026, '0', '修改公告表', 'pig-boot', 'admin', ' ', '2024-04-24 10:36:26', NULL, '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/105.0.0.0 Safari/537.36', '/admin/carAnnouncement', 'PUT', '[{\"announcementId\":1,\"userId\":1,\"title\":\"关于停车收费调整的公告\",\"content\":\"为了更好的维护和管理停车场，我们将于即日起对停车收费进行调整。具体如下：  小型车辆每小时5元，大型车辆每小时10元。 停车不足一小时按一小时计算。 超过24小时未取车的，将按照每天50元的标准进行收费。 感谢您的理解和支持，如有任何疑问，请随时联系我们。\",\"publishTime\":\"2024-04-11 15:51:26\"}]', 4, '0', NULL);
INSERT INTO `sys_log` VALUES (1782964256422158338, '0', '新增公告表', 'pig-boot', 'admin', ' ', '2024-04-24 10:46:19', NULL, '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/105.0.0.0 Safari/537.36', '/admin/carAnnouncement', 'POST', '[{\"announcementId\":1782964256191471617,\"userId\":1,\"title\":\"新增电动车充电站公告\",\"content\":\"尊敬的车主们：  为了更好地服务我们的客户，我们在停车场新增了电动车充电站。以下是一些相关信息：  充电站位于停车场的特定区域，设有多个充电口。 充电费用为每度电0.5元，充电时间根据电动车型和电池容量而定。 我们提供预约服务，如有需要，请提前联系我们。 感谢您的支持，如有任何疑问，欢迎随时与我们联系。\",\"publishTime\":null}]', 43, '0', NULL);
